import React, { Component } from "react";

class UserBar extends Component {
  render() {
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <form>
          <label>Email</label>
          <input type="text" name="email" />

          <label>Password</label>
          <input type="password" name="password" />
        </form>
      </div>
    );
  }
}
export default UserBar;
